class SinglepostComponent {
    constructor(router, apiService, activatedRoute) {
        this.router = router;
        this.apiService = apiService;
        this.activatedRoute = activatedRoute;
        this.post = {};
        this.comentarios = [];
        this.loading = false;
        this.activatedRoute
            .params
            .subscribe(params => {
            if (params.id) {
                this.loading = true;
                this.id = params.id;
                this.apiService.get("/posts/" + this.id)
                    .subscribe((response) => {
                    this.post = response;
                    this.loading = false;
                }, error => {
                    console.log(error);
                    alert(JSON.stringify(error.error || error));
                    this.loading = false;
                    // this.goBack();
                });
                this.apiService.get("/posts/" + this.id + "/comments")
                    .subscribe((response) => {
                    this.comentarios = response;
                }, error => {
                    console.log(error);
                    alert(JSON.stringify(error.error || error));
                    // this.goBack();
                });
            }
            else {
                this.goBack();
            }
        });
    }
    goBack() {
        this.router.navigate(["/posts"]);
    }
    ngOnInit() {
    }
}
